import { BrowserRouter as Router, Route, Switch } from "react-router-dom"; // Import React Router components
import AddKnittingDetailsForm from "./Components/AddKnittingDetails"; // Import your form component

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/add-sample-details" component={AddSampleDetails} />
        <Route path="/knitting-details" component={AddKnittingDetailsForm} />
      </Switch>
    </Router>
  );
}

export default App;
